  true,\n\t\"url\": null,\n\t\"notes\": \"Rare earth element measurements for thermal
  fluids from Surprise Valley, California. Samples were collected in acid washed HDPE
  bottles and acidified with concentrated trace element clean (Fisher Scientific)
  nitric acid. Samples were pre-concentratated by a factor of approximately 10 using
  chelating resin with and IDA functional group and measured on magnetic sector ICP-MS.
  \ Samples include Seyferth Hot Springs, Surprise Valley Resort Mineral Well, Leonard's
  Hot Spring, and Lake City Mud Volcano Boiling Spring.\",\n\t\"license_title\": \"Creative
